<h4>编程语言</h4>
<ul>
<li><strong>Java</strong>: 熟练使用Java进行企业级应用开发，精通Spring Boot框架，擅长构建高性能和可扩展的后端服务。</li>
<li><strong>C++</strong>: 具备扎实的C++基础，能够开发高效的系统级应用程序。</li>
<li><strong>C</strong>: 精通C语言，擅长底层编程和系统开发。</li>
